import { startCanvasAnimation } from './CanvasAnimation';
import {motion, AnimatePresence} from "framer-motion";
import React, { useState, useEffect } from 'react';
import './Canvas.css';

function Canvas() {
    useEffect(() => {
        startCanvasAnimation();
    }, []);

    return (
        <motion.div 
        initial={{ opacity: 1 }} // Initial opacity and scale of the image
        animate={{ opacity: 1}} // Fade in and scale in animation
        transition={{ delay: 1.2, duration: 1 }} // Duration of the animation
            id="canvasContainer">
            <canvas class="canvas" id="bgCanvas"></canvas>
            <canvas class="canvas" id="terCanvas"></canvas>
        </motion.div>
    );
}

export default Canvas;
